import React from 'react';
import { Link } from "react-router-dom";

function ScroeBoard() {
    return (
        <div>
            <div>
                <h1>ScroeBoard</h1>
            </div>
            <div>
                <Link to="/">Back</Link>
            </div>
        </div>
    );
  }
export default ScroeBoard;
